import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Main.css";
import ProblemsBox from "./ProblemsBox";
import TasksBox from "./TasksBox";
import InvoiceModal from "./InvoiceModal";
import NewVoteModal from "./NewVoteModal";
import VotingBox from "./VotingBox";

function Main() {
  const navigate = useNavigate();
  const [user, setUser] = useState({});

  const [isInvoiceModalOpen, setIsInvoiceModalOpen] = useState(false);
  const [isVoteModalOpen, setIsVoteModalOpen] = useState(false);

  // Stav pre zoznam hlasovaní, tento sa používa len raz
  const [votes, setVotes] = useState([]); // Tento riadok je už len raz

  useEffect(() => {
    // Vytiahnutie user dat z lokal uloziska
    const storedUser = JSON.parse(localStorage.getItem("user"));
    if (storedUser) {
      setUser(storedUser);
    } else {
      navigate("/"); // Redirect ak nie su najdene data
    }
  }, [navigate]);

  // Funkcia na logout
  const handleLogout = () => {
    // Na odhlásenie vyčistí storage, ktorú naplnilo v Login.js pri response
    localStorage.removeItem("isAuthenticated");

    // Redirect na login page
    navigate("/");
  };

  // logika pre box s fakturami
  const toggleInvoiceModal = () => {
    setIsInvoiceModalOpen(!isInvoiceModalOpen);
  };

  /* -------- HLASOVANIE -------- */
  // Funkcia na otvorenie/zatvorenie modalu
  const toggleVoteModal = () => {
    setIsVoteModalOpen(!isVoteModalOpen);
  };

  // Funkcia na pridanie nového hlasovania
  const addNewVote = (newVote) => {
    setVotes((prevVotes) => [...prevVotes, newVote]); // Používame callback pre správnu aktualizáciu
  };


  return (
    <div className="dashboard-container">
      {/* Sidebar */}
      <div className="sidebar">
        <p className="sidebar-address">Podivínska 12 Košice</p>
        <nav className="nav-links">
          <a href="#" className="nav-item">
            <div className="nav-button">
              <img src="./Home.svg" alt="Home Icon" className="nav-icon" />
            </div>
            <span>Home</span>
          </a>
          <a href="?" className="nav-item">
            <div className="nav-button">
              <img
                src="./Document.svg"
                alt="Document Icon"
                className="nav-icon"
              />
            </div>
            <span>Dokumenty</span>
          </a>
        </nav>
      </div>

      <div className="main-content">
        <div className="header">
          <span>
            {user.meno} {user.priezvisko}
          </span>
          <span>Byt č. {user.cislo_bytu}</span>
          <button className="logout-button" onClick={handleLogout}>
            <img src="./Logout.svg" alt="Logout" className="logout-icon" />
          </button>
        </div>

        <div className="dashboard-body">
          <div className="account-box">
            <div className="account-header">
              <h3>Stav uctu: 5824,58€</h3>
              <button className="add-btn" onClick={toggleInvoiceModal}>
                <img src="./Add.svg" alt="Add Icon" className="add-icon" />
              </button>
            </div>
            <hr />
            <div className="account-graph">TU GRAF xdd</div>
          </div>

          {/* Komponent pre zobrazenie uloh */}
          <TasksBox />

          <VotingBox votes={votes} toggleVoteModal={toggleVoteModal} />
          {/* Komponent pre zobrazenie problémov */}
          <ProblemsBox />
        </div>
      </div>
      {/* Komponent pre zobrazenie sumbmit boxy pre faktury */}
      <InvoiceModal
        isOpen={isInvoiceModalOpen}
        toggleModal={toggleInvoiceModal}
      />

      {/* Hlasovanie Modal */}
      <NewVoteModal 
        isOpen={isVoteModalOpen} 
        toggleModal={toggleVoteModal} 
        addNewVote={addNewVote} // Predáme funkciu na pridanie nového hlasovania
      />
    </div>
  );
}

export default Main;
